import {themecontext} from '../../Context'
import { useContext } from "react";
const Toggle = () => {
  const theme = useContext(themecontext)
  return (
    <div className="toggle">
        <Moon/>
        <Sun/>
        <div className="t-button"></div>
    </div>
  )
}

export default Toggle
